import React from "react";
import { Link } from "react-router-dom";

export default function NotFound() {
  return (
    <div className="min-h-screen bg-gradient-to-b from-blue-50 to-blue-100 text-gray-900 flex flex-col items-center justify-center">
      <h1 className="text-6xl font-extrabold text-blue-800">404</h1>
      <p className="mt-4 text-xl text-gray-700">Oops! The page you're looking for doesn't exist.</p>
      <Link
        to="/"
        className="mt-6 px-8 py-3 text-lg bg-blue-800 text-white shadow-lg rounded-md hover:bg-blue-900 transition-transform"
      >
        Go Back Home
      </Link>
    </div>
  );
}
